import React, { useState, useEffect } from 'react';
import Editor from '@monaco-editor/react';
import { socket } from '../socket';

const CodingChallenge = () => {
  const [language, setLanguage] = useState('python');
  const [code, setCode] = useState('');
  const [input, setInput] = useState('');
  const [output, setOutput] = useState('');
  const [error, setError] = useState('');
  const [executing, setExecuting] = useState(false);
  const [sessionId, setSessionId] = useState(null);

  useEffect(() => {
    // Create a new session when language changes
    socket.emit('createSession', { language });

    socket.on('sessionCreated', ({ sessionId, boilerplate }) => {
      setSessionId(sessionId);
      setCode(boilerplate);
    });

    socket.on('executionResult', (result) => {
      console.log('Received executionResult:', result);
      setExecuting(false);
      if (result.output && result.output.trim() !== '') {
        setOutput(result.output);
      } else if (result.error && result.error.trim() !== '') {
        setOutput(result.error);
      } else {
        setOutput('');
      }
      setError(result.error || '');
    });

    return () => {
      socket.off('sessionCreated');
      socket.off('executionResult');
    };
  }, [language]);

  const handleLanguageChange = (event) => {
    setLanguage(event.target.value);
  };

  const handleExecuteCode = () => {
    setExecuting(true);
    setOutput('');
    setError('');
    socket.emit('executeCode', {
      sessionId,
      code,
      input,
      language
    });
  };

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      padding: '20px',
      fontFamily: 'Inter, -apple-system, BlinkMacSystemFont, sans-serif'
    }}>
      <div style={{
        maxWidth: '1400px',
        margin: '0 auto',
        background: 'rgba(255, 255, 255, 0.1)',
        backdropFilter: 'blur(10px)',
        borderRadius: '20px',
        padding: '30px',
        border: '1px solid rgba(255, 255, 255, 0.2)',
        color: 'white'
      }}>
        <h1 style={{
          fontSize: '32px',
          fontWeight: '700',
          margin: '0 0 30px 0',
          textAlign: 'center',
          color: 'white'
        }}>
          Practice Mode
        </h1>

        {/* Header Controls */}
        <div style={{
          display: 'flex',
          gap: '20px',
          marginBottom: '30px',
          alignItems: 'center'
        }}>
          <select
            value={language}
            onChange={handleLanguageChange}
            style={{
              background: 'rgba(255, 255, 255, 0.1)',
              border: '1px solid rgba(255, 255, 255, 0.3)',
              borderRadius: '10px',
              padding: '12px 20px',
              color: 'white',
              fontSize: '14px',
              fontWeight: '500',
              cursor: 'pointer',
              outline: 'none',
              minWidth: '150px'
            }}
          >
            <option value="python">Python</option>
            <option value="java">Java</option>
            <option value="cpp">C++</option>
          </select>

          <button
            onClick={handleExecuteCode}
            disabled={executing}
            style={{
              background: executing ? 'rgba(255, 255, 255, 0.1)' : 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
              border: '1px solid rgba(255, 255, 255, 0.3)',
              borderRadius: '12px',
              padding: '12px 30px',
              color: 'white',
              fontSize: '16px',
              fontWeight: '600',
              cursor: executing ? 'not-allowed' : 'pointer',
              transition: 'all 0.3s ease',
              minWidth: '150px'
            }}
          >
            {executing ? 'Executing...' : 'Run Code'}
          </button>
        </div>

        {/* Code Editor */}
        <div style={{
          marginBottom: '30px',
          borderRadius: '15px',
          overflow: 'hidden',
          border: '1px solid rgba(255, 255, 255, 0.2)'
        }}>
          <Editor
            height="500px"
            language={language}
            value={code}
            onChange={setCode}
            theme="vs-dark"
            options={{
              minimap: { enabled: false },
              fontSize: 16,
              lineNumbers: 'on',
              automaticLayout: true,
              scrollBeyondLastLine: false,
              tabSize: 4,
              wordWrap: 'on',
              overviewRulerBorder: false,
              scrollbar: {
                vertical: 'auto',
                horizontal: 'auto',
                verticalScrollbarSize: 10,
                horizontalScrollbarSize: 10
              }
            }}
          />
        </div>

        {/* Input/Output Section */}
        <div style={{
          display: 'grid',
          gridTemplateColumns: '1fr 1fr',
          gap: '30px'
        }}>
          {/* Input Section */}
          <div>
            <h3 style={{
              fontSize: '20px',
              fontWeight: '600',
              margin: '0 0 15px 0',
              color: 'white'
            }}>
              Input
            </h3>
            <textarea
              value={input}
              onChange={(e) => setInput(e.target.value)}
              placeholder="Enter your input here..."
              style={{
                width: '100%',
                minHeight: '150px',
                background: 'rgba(0, 0, 0, 0.2)',
                border: '1px solid rgba(255, 255, 255, 0.2)',
                borderRadius: '12px',
                padding: '15px',
                color: 'white',
                fontSize: '14px',
                fontFamily: 'monospace',
                resize: 'vertical',
                outline: 'none'
              }}
            />
          </div>

          {/* Output Section */}
          <div>
            <h3 style={{
              fontSize: '20px',
              fontWeight: '600',
              margin: '0 0 15px 0',
              color: 'white'
            }}>
              Output
            </h3>
            <div style={{
              width: '100%',
              minHeight: '150px',
              background: 'rgba(0, 0, 0, 0.2)',
              border: '1px solid rgba(255, 255, 255, 0.2)',
              borderRadius: '12px',
              padding: '15px',
              color: output ? '#4caf50' : 'rgba(255, 255, 255, 0.6)',
              fontSize: '14px',
              fontFamily: 'monospace',
              whiteSpace: 'pre-wrap',
              overflow: 'auto'
            }}>
              {output || 'Output will appear here...'}
            </div>
            
            {error && (
              <div style={{
                marginTop: '15px',
                padding: '12px',
                background: 'rgba(244, 67, 54, 0.1)',
                border: '1px solid rgba(244, 67, 54, 0.3)',
                borderRadius: '8px',
                color: '#f44336',
                fontSize: '14px',
                fontFamily: 'monospace'
              }}>
                {error}
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default CodingChallenge;
